import React from 'react';
import Swiper from 'react-id-swiper';
import 'swiper/css/swiper.css';
import './cardSwiper.scss'


const CardSwiper = () => {
	const params = {
			slidesPerView: 4,
			centeredSlides: true,
			spaceBetween: 30,
			grabCursor: true,
			pagination: {
				el: '.swiper-pagination',
				clickable: true
			}
		}
		return (
			<Swiper {...params}>
				<div id="one">Slide #1</div>
				<div>Slide #2</div>
				<div>Slide #3</div>
				<div>Slide #4</div>
				<div>Slide #5</div>
			</Swiper>
		)
};


export default CardSwiper;
